import React, { Component } from "react";
import {} from "react-onsenui";

class Results extends Component {
  render() {
    return (
      <>
        <section style={{ margin: "16px", textAlign: "center" }}>
          <h1>World</h1>
        </section>
      </>
    );
  }
}

export default Results;
